# Table: phpbb_poll_options
DROP TABLE IF EXISTS phpbb_poll_options;
CREATE TABLE `phpbb_poll_options` (
  `poll_option_id` tinyint(4) NOT NULL DEFAULT '0',
  `topic_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `poll_option_text` text COLLATE utf8_bin NOT NULL,
  `poll_option_total` mediumint(8) unsigned NOT NULL DEFAULT '0',
  KEY `poll_opt_id` (`poll_option_id`),
  KEY `topic_id` (`topic_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

# Table: phpbb_poll_votes
DROP TABLE IF EXISTS phpbb_poll_votes;
CREATE TABLE `phpbb_poll_votes` (
  `topic_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `poll_option_id` tinyint(4) NOT NULL DEFAULT '0',
  `vote_user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `vote_user_ip` varchar(40) COLLATE utf8_bin NOT NULL DEFAULT '',
  KEY `topic_id` (`topic_id`),
  KEY `vote_user_id` (`vote_user_id`),
  KEY `vote_user_ip` (`vote_user_ip`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

# Table: phpbb_posts
DROP TABLE IF EXISTS phpbb_posts;
CREATE TABLE `phpbb_posts` (
  `post_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `topic_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `forum_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `poster_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `icon_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `poster_ip` varchar(40) COLLATE utf8_bin NOT NULL DEFAULT '',
  `post_time` int(11) unsigned NOT NULL DEFAULT '0',
  `post_approved` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `post_reported` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `enable_bbcode` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_smilies` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_magic_url` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_sig` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `post_username` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `post_subject` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `post_text` mediumtext COLLATE utf8_bin NOT NULL,
  `post_checksum` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '',
  `post_attachment` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `bbcode_bitfield` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `bbcode_uid` varchar(8) COLLATE utf8_bin NOT NULL DEFAULT '',
  `post_postcount` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `post_edit_time` int(11) unsigned NOT NULL DEFAULT '0',
  `post_edit_reason` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `post_edit_user` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `post_edit_count` smallint(4) unsigned NOT NULL DEFAULT '0',
  `post_edit_locked` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`post_id`),
  KEY `forum_id` (`forum_id`),
  KEY `topic_id` (`topic_id`),
  KEY `poster_ip` (`poster_ip`),
  KEY `poster_id` (`poster_id`),
  KEY `post_approved` (`post_approved`),
  KEY `post_username` (`post_username`),
  KEY `tid_post_time` (`topic_id`,`post_time`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

INSERT INTO phpbb_posts (post_id, topic_id, forum_id, poster_id, icon_id, poster_ip, post_time, post_approved, post_reported, enable_bbcode, enable_smilies, enable_magic_url, enable_sig, post_username, post_subject, post_text, post_checksum, post_attachment, bbcode_bitfield, bbcode_uid, post_postcount, post_edit_time, post_edit_reason, post_edit_user, post_edit_count, post_edit_locked) VALUES (5, 3, 4, 2, 0, '86.185.76.91', 1372105457, 1, 0, 1, 1, 1, 1, '', 'Applying for Group Membership', 'Hey everyone,\n\nWith the new forums, you will need to apply for new group membership.\n\nPlease post here with what group you are in, in the alliance, and I will add you to the appropriate group ASAP.\n\nGroups are:\nAlliance Applicant\nAlliance Member\nAlliance Officer\nAlliance Leader\n\nThanks!', '3cf4f731343995c9529cbca274fdf7e9', 0, '', '2vwhoboo', 1, 0, '', 0, 0, 0),(2, 2, 21, 2, 0, '86.185.76.91', 1371740429, 1, 0, 1, 1, 1, 1, '', 'Welcome to the new CCA Forums!', 'Just a quick welcome!\n\n(And a test to see how it looks <!-- s;) --><img src=\"{SMILIES_PATH}/icon_e_wink.gif\" alt=\";)\" title=\"Wink\" /><!-- s;) -->)', 'c78b13f235707b2112a3545bd44e4abd', 0, '', '3dqke9mh', 1, 0, '', 0, 0, 0),(6, 2, 21, 55, 0, '94.172.164.33', 1372166358, 1, 0, 1, 1, 1, 1, '', 'Re: Welcome to the new CCA Forums!', '[quote=&quot;Jade&quot;:3bd8r7gf]Just a quick welcome!\n\n(And a test to see how it looks <!-- s;) --><img src=\"{SMILIES_PATH}/icon_e_wink.gif\" alt=\";)\" title=\"Wink\" /><!-- s;) -->)[/quote:3bd8r7gf]\n\nHowdy, Seems to be working mighty fine\n <!-- s:mrgreen: --><img src=\"{SMILIES_PATH}/icon_mrgreen.gif\" alt=\":mrgreen:\" title=\"Mr. Green\" /><!-- s:mrgreen: -->', 'fc8925416e1d06b05d6131d0a0a0f030', 0, 'gA==', '3bd8r7gf', 1, 0, '', 0, 0, 0),(7, 4, 4, 55, 0, '94.172.164.33', 1373272276, 1, 0, 1, 1, 1, 0, '', 'Epidemic', 'Howdy all,\nJust posting an update on my status.\nAfter the operation it all went well. Unfortunately as im sure you have noticed ive not been around much at all.\nits still hard to sit down at my desk for more then 5 mins at a time.\nEventually everything should heal and be back to normal.\n\nHope Everyone is doing well and the raids i here have made progress since i last attended 1. well done guys <!-- s:) --><img src=\"{SMILIES_PATH}/icon_e_smile.gif\" alt=\":)\" title=\"Smile\" /><!-- s:) -->\n\ni see jade is doing a great job at making us a new website that will be easier to use then the current system we have, don\'t for get anything you want to see on here let jade know <!-- s:) --><img src=\"{SMILIES_PATH}/icon_e_smile.gif\" alt=\":)\" title=\"Smile\" /><!-- s:) -->\n\nfeel free to inbox me in game or on here i do come and login every morning to check my mail <!-- s:) --><img src=\"{SMILIES_PATH}/icon_e_smile.gif\" alt=\":)\" title=\"Smile\" /><!-- s:) -->\nand any messages would be great.. its getting rather boring now looking at the same 4 walls for aprox 6 weeks and it looks like be another 4 week before i can think about work <!-- s:( --><img src=\"{SMILIES_PATH}/icon_e_sad.gif\" alt=\":(\" title=\"Sad\" /><!-- s:( -->\n\nwell the sun is coming up think its gonna be another hot 1 so im going to take my self out side and listen to some tunes, got a lovely blowup  bed for out to lie on <!-- s:) --><img src=\"{SMILIES_PATH}/icon_e_smile.gif\" alt=\":)\" title=\"Smile\" /><!-- s:) -->\n\nSee you soon\n\nRegards\nEpidemic\n ( Martin )', '9cc24b5eec6444f53bdab9309f1b0a5f', 0, '', 'rjqqzbuu', 1, 0, '', 0, 0, 0),(8, 5, 21, 2, 0, '86.185.78.168', 1373556530, 1, 0, 1, 1, 1, 1, '', '[Important] - DST Setting', 'Hello all,\n\nTo keep the times on the Raid Calendar and Homepage all in sync, please could you manually keep your DST time setting up to date.\n\nYou can find this setting in your profile: [url:3vr0oil4]http&#58;//crimson-alliance&#46;com/forum/ucp&#46;php[/url:3vr0oil4]\n\nIf you are unsure whether you are in DST or not, check your computer clock settings, and it should say something like:\n\n[img:3vr0oil4]http&#58;//img59&#46;imageshack&#46;us/img59/741/cbw2&#46;png[/img:3vr0oil4]\n[size=85:3vr0oil4]To find this, right click your clock on your taskbar, and click &quot;Adjust Date/Time&quot;.[/size:3vr0oil4]\n\nI will be trying to find a way to automatically update this for people, but the only mod I can find is very old and unsupported, which means I may have to figure out a way to code it myself.\n\nThank you all,\nJade', '707dedd388b7c6e0f939bdb384abfb4b', 0, 'HA==', '3vr0oil4', 1, 0, '', 0, 0, 0),(9, 6, 21, 2, 0, '86.185.78.168', 1373556733, 1, 0, 1, 1, 1, 1, '', '[Important] - Apply to your Usergroup!', 'Hey all,\n\nIf you are not in the correct Usergroup you may apply to join one here: [url:1xb0wkb1]http&#58;//crimson-alliance&#46;com/forum/ucp&#46;php?i=176[/url:1xb0wkb1]\n\nAfter you have applied, please give time for an admin to check your application, and your group will be updated as soon as possible.\n\nThank you,\nJade', 'b3f89848c89820ad578130a5ce64dd7d', 0, 'EA==', '1xb0wkb1', 1, 0, '', 0, 0, 0),(10, 7, 24, 2, 0, '86.185.78.168', 1373575416, 1, 0, 1, 1, 1, 1, '', '[Raids] - Subscribe to Me!', 'Subscribe for notifications if you would like to be notified via email each time a raid is posted.\n\nIf you don\'t subscribe, you will still receive a forum PM if the event poster requests it.\n\nThanks,\nJade', '7f9ac56d7752883bf398c52b8204f3b7', 0, '', '1wa4ae0m', 1, 0, '', 0, 0, 0),(13, 7, 24, 2, 0, '86.185.78.168', 1373576748, 1, 0, 1, 1, 1, 0, '', 'New Raid Posted', '[color=#BF00BF:f9cmuuxt][size=150:f9cmuuxt][b:f9cmuuxt]Grim Awakening[/b:f9cmuuxt][/size:f9cmuuxt][/color:f9cmuuxt]\r\n			\r\n			[b:f9cmuuxt]Date:[/b:f9cmuuxt] 17-07-2013\r\n			[b:f9cmuuxt]Time:[/b:f9cmuuxt] 6:30 pm\r\n			\r\n			[b:f9cmuuxt][url=http&#58;//www&#46;crimson-alliance&#46;com/event_signup&#46;php?id=45:f9cmuuxt]Click here to sign up.[/url:f9cmuuxt][/b:f9cmuuxt]\r\n			\r\n			[b:f9cmuuxt]Description:[/b:f9cmuuxt]\r\n			<p>Dummy Event Post! Test away!</p>', '96e088e5c042556953daf52e862e3123', 0, 'Vg==', 'f9cmuuxt', 1, 0, '', 0, 0, 0),(14, 7, 24, 55, 0, '94.172.164.33', 1373582497, 1, 0, 1, 1, 1, 0, '', 'New Raid Posted', '[color=#BF00BF:fzvhud0u][size=150:fzvhud0u][b:fzvhud0u]Endless Eclipse[/b:fzvhud0u][/size:fzvhud0u][/color:fzvhud0u]\r\n			\r\n			[b:fzvhud0u]Date:[/b:fzvhud0u] 14-07-2013\r\n			[b:fzvhud0u]Time:[/b:fzvhud0u] 9:30 pm\r\n			\r\n			[b:fzvhud0u][url=http&#58;//www&#46;crimson-alliance&#46;com/event_signup&#46;php?id=46:fzvhud0u]Click here to sign up.[/url:fzvhud0u][/b:fzvhud0u]\r\n			\r\n			[b:fzvhud0u]Description:[/b:fzvhud0u]\r\n			<p>This will be 1 night to remember everyone must bring party food and drink <!-- s;) --><img src=\"{SMILIES_PATH}/icon_e_wink.gif\" alt=\";)\" title=\"Wink\" /><!-- s;) --></p>', 'c146b641fcae478954faea020a4d4173', 0, 'Vg==', 'fzvhud0u', 1, 0, '', 0, 0, 0),(15, 7, 24, 2, 0, '86.185.78.168', 1373583644, 1, 0, 1, 1, 1, 1, '', 'Re: [Raids] - Subscribe to Me!', 'Testing for Epi.\n\nRAWR! <!-- s:D --><img src=\"{SMILIES_PATH}/icon_e_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D -->', '9d94a392d3296841a0a009c129ff168d', 0, '', '2ub6ny8x', 1, 0, '', 0, 0, 0);

# Table: phpbb_privmsgs
DROP TABLE IF EXISTS phpbb_privmsgs;
CREATE TABLE `phpbb_privmsgs` (
  `msg_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `root_level` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `author_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `icon_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `author_ip` varchar(40) COLLATE utf8_bin NOT NULL DEFAULT '',
  `message_time` int(11) unsigned NOT NULL DEFAULT '0',
  `enable_bbcode` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_smilies` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_magic_url` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `enable_sig` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `message_subject` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `message_text` mediumtext COLLATE utf8_bin NOT NULL,
  `message_edit_reason` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `message_edit_user` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `message_attachment` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `bbcode_bitfield` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '',
  `bbcode_uid` varchar(8) COLLATE utf8_bin NOT NULL DEFAULT '',
  `message_edit_time` int(11) unsigned NOT NULL DEFAULT '0',
  `message_edit_count` smallint(4) unsigned NOT NULL DEFAULT '0',
  `to_address` text COLLATE utf8_bin NOT NULL,
  `bcc_address` text COLLATE utf8_bin NOT NULL,
  `message_reported` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`msg_id`),
  KEY `author_ip` (`author_ip`),
  KEY `message_time` (`message_time`),
  KEY `author_id` (`author_id`),
  KEY `root_level` (`root_level`)
) ENGINE=MyISAM AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

