 url(\"{IMG_ICON_POST_QUOTE_SRC}\");\n}\n\n.phpbb .signature, .phpbb .notice {\n	color: #444;\n	border-color: #e8e8e8;\n}\n\n.phpbb .posthilit {\n	background-color: #e3e37f;\n}\n\n/*\n	BBCode\n*/\n.phpbb blockquote, .phpbb blockquote cite, .phpbb .attachbox, .phpbb .attachbox dt, .phpbb .codebox, .phpbb .codebox dt, .phpbb .inline-attachment {\n	border-color: #e0e0e0;\n}\n.phpbb blockquote, .phpbb .attachbox, .phpbb .codebox, .phpbb .inline-attachment {\n	background-color: #f4f4f4;\n}\n.phpbb blockquote blockquote, .phpbb blockquote .attachbox, .phpbb blockquote .codebox {\n	background-color: #f8f8f8;\n}\n.phpbb blockquote, .phpbb .attachbox dt, .phpbb .codebox dt {\n	color: #606060;\n}\n.phpbb blockquote cite {\n	color: #000;\n}\n\n/*\n	Tabs\n*/\n.phpbb #tabs li a, .phpbb #minitabs li a {\n	background-color: #f8f8f8;\n	border-color: #d8d8d8;\n}\n.phpbb #tabs li a:hover, .phpbb #minitabs li a:hover {\n	background-color: #333333;\n	border-color: #333333;\n	color: #fff;\n}\n.phpbb #tabs li.activetab a, .phpbb #tabs #active-subsection a, .phpbb #minitabs li.activetab a {\n	background-color: #333333;\n	border-color: #333333;\n	background-image: url(\"{T_THEME_PATH}/images/category.png\");\n	color: #fff;\n}\n.phpbb #tabs li.activetab a:hover, .phpbb #tabs #active-subsection a:hover, .phpbb #minitabs li.activetab a:hover {\n	background-color: #af2a4b;\n	border-color: #af2a4b;\n	color: #fff;\n}\n\n/*\n	Control panel\n*/\n.phpbb .cp-content {\n	border-color: #d8d8d8;\n}\n\n.phpbb .pm_marked_colour, .phpbb .topiclist > li.pm_marked_colour > dl dt {\n	border-color: #982aaf;\n}\n.phpbb .pm_replied_colour, .phpbb .topiclist > li.pm_replied_colour > dl dt {\n	border-color: #333333;\n}\n.phpbb .pm_friend_colour, .phpbb .topiclist > li.pm_friend_colour > dl dt {\n	border-color: #2aaf30;\n}\n.phpbb .pm_foe_colour, .phpbb .topiclist > li.pm_foe_colour > dl dt {\n	border-color: #af2a4b;\n}\n\n.phpbb dl.details dt {\n	color: #808080;\n}\n \n/*\n	Avatars gallery\n*/\n.phpbb #gallery label:hover {\n	border-color: #d0d0d0;\n	background-color: #fafafa;\n}\n\n/*\n	RSS feed\n*/\n.phpbb a.feed-icon-forum {\n	background-image: url(\"{T_THEME_PATH}/images/rss.png\");\n}\n/* Main Layout Settings\n----------------------- */\nhtml {\n	background: url(http://www.crimson-alliance.com/images/background.png) no-repeat fixed center top;\n	background-size: auto 1080px;\n	background-color: transparent;\n}\nhtml, body {\n	height: 100%;\n	min-width: 1280px;\n}\n\nbody {\n	margin: 0px;\n	padding: 0px;\n}\n\ndiv#footer_wrapper {\n	width: 100%;\n	height: 40px;\n}\n\ndiv#content_wrapper {\n	width: 100%;\n	padding: 0 0 41px 0;\n}\n\ndiv#header_wrapper {\n	width: 100%;\n	height: 100px;\n}\n\ndiv#footer_wrapper,\ndiv#content_wrapper,\ndiv#header_wrapper {\n	min-width: 100%;\n}\n\n/* Header Settings\n----------------------- */\ndiv#header {\n	height: 60px;\n	background: url(\'http://www.crimson-alliance.com/images/headerbg.png\') center center no-repeat #000;\n	background-size: cover;\n	text-align: center;\n}\n\n/* Navigation Settings\n----------------------- */\ndiv#nav {\n	width: 100%;\n	height: 40px;\n	overflow: hidden;\n	font-family: Georgia, \"Times New Roman\", Times, serif;\n	font-weight: bold;\n	font-size: 18px;\n	background: #000;\n	border-bottom: 1px solid #111;\n}\ndiv#nav ul {\n	float: left;\n	list-style: none;\n	position: relative;\n	left: 50%;\n	text-align: center;\n	padding: 0;\n	margin: 0;\n}\ndiv#nav ul li {\n	display: block;\n	float: left;\n	list-style: none;\n	position: relative;\n	right: 50%;\n        height: 40px;\n}\ndiv#nav ul li a {\n	display: block;\n	float: left;\n	padding: 10px;\n	text-decoration: none;\n	color: #FFF;\n        height: 40px;\n        line-height: 20px;\n}\ndiv#nav ul li a:hover,\ndiv#nav ul li.active a,\ndiv#nav ul li.active a:hover {\n	background: #860111;\n	color: #FFF;\n}\n\n/* Footer Settings\n----------------------- */\ndiv.footer_content {\n	line-height: 40px;\n	text-align: center;\n	background: #000;\n	border-top: 1px solid #111;\n        color: #FFF;\n}\ndiv.footer_content a {\n	color: #FFF;\n	text-decoration: underline;\n	border: 0;\n}\ndiv.footer_content a:visited {\n	color: #CCC;\n	text-decoration: underline;\n	border: 0;\n}\ndiv.footer_content a:hover {\n	color: #F03;\n	text-decoration: underline;\n	border: 0;\n}\ndiv#wrapper {\n	width: 100%;\n	min-height: 100%;\n	height: auto !important;\n	height: 100%;\n	margin: 0 0 -41px 0;\n	background: url(http://www.crimson-alliance.com/images/transbg2.png) center top repeat-y;\n	background-size: 1280px 100%;\n}');

